     * For num = "2020" the output should be 2.
     *
     * > hexKey("AB")
     * 1
     * > hexKey("1077E")
     * 2
     * > hexKey("ABED1A33")
     * 4
     * > hexKey("2020")
     * 2
     * > hexKey("123456789ABCDEF0")
     * 6
     * > hexKey("112233445566778899AABBCCDDEEFF00")
     * 12
     * > hexKey([])
     * 0
     */
    public static int hexKey(Object num) {
